css:
.fb-symbol-wiki-toolbar {
  display: flex;
  justify-content: space-between;
  padding: 0.5em 0 0 0;
}
.fb-symbol-wiki-toolbar-left,
.fb-symbol-wiki-toolbar-right {
  align-items: center;
  display: flex;
  overflow: hidden;
  white-space: nowrap;
}
.fb-symbol-wiki-toolbar-right {
  justify-content: flex-end;
}
.fb-symbol-wiki-summary-container {
  padding-left: 1em;
  padding-right: 1em;
}
